/**
 * 作者：Mr.wang
 * 时间：2022/4/15
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */

//引入UI组件
import CountUI from "../../components/Count";

//引入connect用于链接UI组件与redux
import {connect} from "react-redux"
// 函数的返回值对象中的key就作为传递给UI组件的props的值 -- 状态
function a() {
    return {n:100}
}

// 返回操作状态的方法
function b() {
    return {
        increment:(value)=>{
         console.log(this)
     }
    }
}
//创建并暴露一个count的容器组件
export default connect(a,b)(CountUI)
